import React from 'react';
import { Container, Card } from 'react-bootstrap';

const CGT2lead = () => {
  return (
    <Container className="my-5">
      <Card className="border-0">
        <Card.Body>
          <Card.Title as="h2" className="mb-4">Lagos Real Estate Reaches New Heights</Card.Title>
          <Card.Text className="lead">
            Lagos real estate discovered a new height after Churchgate Tower 2 was erected. Rising to the sky from Victoria Island with its modern design and top-class styling, Tower 2 has become the home of some of the fastest-growing startups in Nigeria and is a sought-after office location for multinational corporations and Fortune 500 companies looking to satisfy their distinguished teams and clients.
          </Card.Text>
          
          <Card.Text>
            Churchgate Tower 2 is an excellent choice for anyone looking for high-class office space that offers the best 21st-century experience with assured industry-standard amenities and expansive views of the Atlantic Ocean and the Lagos Lagoon. It is much more than meets the eye.
          </Card.Text>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default CGT2lead;
